INSERT INTO `mail_settings` VALUES ('4', 'customer_print', null, 'Thông tin làm thẻ của khách hàng {name_cmnd}', '<meta charset=\"utf-8\">\r\n<title></title>\r\n<style type=\"text/css\">body {\r\n        margin: 0;\r\n        min-width: 100%;\r\n        font-family: \'Roboto\', Helvetica, Arial, sans-serif;\r\n        font-size: 14px;\r\n	 background-color: #ccc;\r\n    }\r\n	body,td,th,p,div {\r\n	font-family: Roboto, Helvetica, Arial, sans-serif;\r\n	font-size: 14px;\r\n}\r\n	body,div{\r\n		border:none;\r\n	}\r\n	.wrapper_page{\r\n		width:100%;\r\n		text-align: center;\r\n	}\r\n	.wrapper{\r\n		width: 590px;\r\n		margin: 50px auto;\r\n		margin-left: auto;\r\n		margin-right: auto;\r\n		background-color: #fff; \r\n		border:1px solid #ddd;\r\n		border-radius: 4px;\r\n	}\r\n	body, html{\r\n		background-color: #cccccc;\r\n		background-color: #D0CDCD;\r\n		width:100%;\r\n	}\r\n	.bg{\r\n		 height: 251px\r\n		background: rgba(237,237,237,1);\r\nbackground: -moz-linear-gradient(top, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nbackground: -webkit-gradient(left top, left bottom, color-stop(0%, rgba(237,237,237,1)), color-stop(40%, rgba(255,255,255,1)), color-stop(100%, rgba(255,255,255,1)));\r\nbackground: -webkit-linear-gradient(top, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nbackground: -o-linear-gradient(top, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nbackground: -ms-linear-gradient(top, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nbackground: linear-gradient(to bottom, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nfilter: progid:DXImageTransform.Microsoft.gradient( startColorstr=\'#ededed\', endColorstr=\'#ffffff\', GradientType=0 );\r\n	}\r\n</style>\r\n<div class=\"wrapper_page\">\r\n<div class=\"wrapper\">\r\n<table class=\"one-col table-logo\" style=\"border-collapse: collapse; border-spacing: 0; margin-left: auto; margin-right: auto; width: 590px; background-color: #ffffff;\">\r\n	<tbody>\r\n		<tr>\r\n			<td align=\"center\" height=\"80\" style=\"vertical-align: top; color: #666; font-size: 12px; text-align: center;\" valign=\"middle\"><img alt=\"\" src=\"https://cyberinsights.cyberinsights.vn/assets/image/logo.svg\" style=\"margin-top: 10px; height: 47px; width: 155px;\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\"center\" style=\"vertical-align: top; color: #666; font-size: 12px; text-align: center;\" valign=\"middle\">\r\n			\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td height=\"35\">\r\n			<p style=\"margin-bottom: 5px; text-align: left;color: #000; margin-left: 30px;\"><strong>K&iacute;nh gửi bộ phận l&agrave;m thẻ,</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<div style=\"margin-left: 30px;\">\r\n			<table border=\"0\" cellpadding=\"2\" cellspacing=\"2\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td height=\"30\" style=\"text-align: left;\" width=\"31%\">M&atilde; kh&aacute;ch h&agrave;ng:</td>\r\n						<td style=\"text-align: left;\" width=\"69%\"><strong>{id}</strong></td>\r\n					</tr>\r\n					<tr>\r\n						<td height=\"30\" style=\"text-align: left;\">Họ v&agrave; t&ecirc;n:</td>\r\n						<td style=\"text-align: left;\"><strong><span style=\"color: rgb(50, 50, 50); font-size: 14px;\">{name_cmnd}</span></strong></td>\r\n					</tr>\r\n					<tr>\r\n						<td height=\"30\" style=\"text-align: left;\">T&ecirc;n in tr&ecirc;n thẻ:</td>\r\n						<td style=\"text-align: left;\"><strong><span style=\"color: rgb(50, 50, 50); font-size: 14px;\">{name}</span></strong></td>\r\n					</tr>\r\n					<tr>\r\n						<td height=\"30\" style=\"text-align: left;\">Ng&agrave;y sinh:</td>\r\n						<td style=\"text-align: left;\"><strong>{birthday}</strong></td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</div>\r\n\r\n			<div style=\"margin-left: 30px;\">\r\n			<table style=\"width: 100%; margin-top: 20px\">\r\n				<tbody>\r\n					<tr>\r\n						<td>\r\n						<p>Vui l&ograve;ng cập nhật lại th&ocirc;ng tin kh&aacute;ch h&agrave;ng sau khi đ&atilde; ho&agrave;n thiện việc in thẻ.&nbsp;</p>\r\n						<a href=\"{link_admin}admin/customerlist/view/{id}\" style=\"color:#ca6f6d;font-weight:bold\">{link_admin}admin/customerlist/view/{id}</a></td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</div>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"line-height: 28px;font-size: 14px;padding-top: 30px\">\r\n			<p style=\"margin-left: 30px; text-align: left;\"><em>Tr&acirc;n trọng!</em></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"line-height: 28px;font-size: 14px\">\r\n			<p style=\"margin-left: 30px; margin-bottom: 30px; text-align: left;\"><em>Đội ngũ cyberinsights</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>', '{}', '1480383516', '1', '1524459716', '1');
INSERT INTO `mail_settings` VALUES ('5', 'forgot', null, 'Thông tin lấy lại mật khẩu', '<meta http-equiv=\"Content-Type\" content=\"text/html; charset=utf-8\" />\r\n<title></title>\r\n<style type=\"text/css\">body {\r\n        margin: 0;\r\n        min-width: 100%;\r\n        font-family: \'Roboto\';\r\n        font-size: 14px;\r\n    }\r\n	body,td,th,p,div {\r\n	font-family: Roboto, Helvetica, Arial, sans-serif;\r\n	font-size: 14px;\r\n}\r\n	body,div{\r\n		border:none;\r\n	}\r\n	.wrapper_page{\r\n		width:100%;\r\n		text-align: center;\r\n	}\r\n	.wrapper{\r\n		width: 590px;\r\n		margin: 50px auto;\r\n		margin-left: auto;\r\n		margin-right: auto;\r\n		background-color: #fff; \r\n		\r\n		border-radius: 4px;\r\n	}\r\n	body, html{\r\n		width:100%;\r\n	}\r\n	.bg{\r\n		 height: 251px\r\n		background: rgba(237,237,237,1);\r\nbackground: -moz-linear-gradient(top, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nbackground: -webkit-gradient(left top, left bottom, color-stop(0%, rgba(237,237,237,1)), color-stop(40%, rgba(255,255,255,1)), color-stop(100%, rgba(255,255,255,1)));\r\nbackground: -webkit-linear-gradient(top, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nbackground: -o-linear-gradient(top, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nbackground: -ms-linear-gradient(top, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nbackground: linear-gradient(to bottom, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nfilter: progid:DXImageTransform.Microsoft.gradient( startColorstr=\'#ededed\', endColorstr=\'#ffffff\', GradientType=0 );\r\n	}\r\n</style>\r\n<div class=\"wrapper_page\">\r\n<div class=\"wrapper\">\r\n<table cellpadding=\"0\" cellspacing=\"0\" class=\"one-col table-logo\" style=\"border-collapse: collapse; border-spacing: 0; margin-left: auto; margin-right: auto; width: 590px; background-color: #ffffff;border:1px solid #ddd;\">\r\n	<tbody>\r\n		<tr>\r\n			<td>\r\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td align=\"center\" height=\"100\" valign=\"middle\"><span style=\"vertical-align: top; color: #666; font-size: 12px; text-align: center;\"><img alt=\"\" src=\"https://cyberinsights.cyberinsights.vn/assets/image/logo.svg\" style=\"height: 47px; width: 155px;\" /></span></td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			\r\n		</tr>\r\n		<tr>\r\n			<td align=\"center\">\r\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"550\">\r\n				<tbody>\r\n					<tr>\r\n						<td valign=\"middle\">&nbsp;</td>\r\n					</tr>\r\n					<tr>\r\n						<td height=\"30\" valign=\"middle\"><strong>Bạn đang y&ecirc;u cầu lấy lại mật khẩu.</strong></td>\r\n					</tr>\r\n					<tr>\r\n						<td height=\"30\" valign=\"middle\">Vui l&ograve;ng nhấn v&agrave;o n&uacute;t b&ecirc;n dưới để tiếp tục lấy lại mật khẩu.</td>\r\n					</tr>\r\n					<tr>\r\n						<td align=\"center\" height=\"70\" valign=\"middle\">\r\n						<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"170\">\r\n							<tbody>\r\n								<tr>\r\n									<td align=\"center\" bgcolor=\"#ed1c24\" height=\"40\" valign=\"middle\"><a href=\"{link}\" style=\"color:#fff;text-decoration: none\"><strong>Lấy lại mật khẩu</strong></a></td>\r\n								</tr>\r\n							</tbody>\r\n						</table>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td height=\"35\">Nếu kh&ocirc;ng phải bạn đang y&ecirc;u cầu lấy lại mật khẩu th&igrave; vui l&ograve;ng bỏ qua thư n&agrave;y..</td>\r\n					</tr>\r\n					<tr>\r\n						<td valign=\"bottom\">&nbsp;</td>\r\n					</tr>\r\n					<tr>\r\n						<td valign=\"bottom\"><em>Tr&acirc;n trọng!</em></td>\r\n					</tr>\r\n					<tr>\r\n						<td height=\"0\" valign=\"top\"><em>Đội ngũ cyberinsights</em></td>\r\n					</tr>\r\n					<tr>\r\n						<td height=\"0\" valign=\"top\">&nbsp;</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>', '{\"token\":\"{token}\"}', '1514270963', '1', '1524479417', '1');
INSERT INTO `mail_settings` VALUES ('6', 'customer_sendmail_templete', null, 'Chương trình cấp thẻ tín dụng Master Platinum của Maritime Bank', '<meta charset=\"utf-8\">\r\n<title></title>\r\n<style type=\"text/css\">body {\r\n        margin: 0;\r\n        min-width: 100%;\r\n        font-family: \'Roboto\', Helvetica, Arial, sans-serif;\r\n        font-size: 14px;\r\n	 background-color: #ccc;\r\n    }\r\n	body,td,th,p,div {\r\n	font-family: Roboto, Helvetica, Arial, sans-serif;\r\n	font-size: 14px;\r\n}\r\n	body,div{\r\n		border:none;\r\n	}\r\n	.wrapper_page{\r\n		width:100%;\r\n		text-align: center;\r\n	}\r\n	.wrapper{\r\n		width: 590px;\r\n		margin: 50px auto;\r\n		margin-left: auto;\r\n		margin-right: auto;\r\n		background-color: #fff; \r\n		border:1px solid #ddd;\r\n		border-radius: 4px;\r\n	}\r\n	body, html{\r\n		background-color: #cccccc;\r\n		background-color: #D0CDCD;\r\n		width:100%;\r\n	}\r\n	.bg{\r\n		 height: 251px\r\n		background: rgba(237,237,237,1);\r\nbackground: -moz-linear-gradient(top, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nbackground: -webkit-gradient(left top, left bottom, color-stop(0%, rgba(237,237,237,1)), color-stop(40%, rgba(255,255,255,1)), color-stop(100%, rgba(255,255,255,1)));\r\nbackground: -webkit-linear-gradient(top, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nbackground: -o-linear-gradient(top, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nbackground: -ms-linear-gradient(top, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nbackground: linear-gradient(to bottom, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nfilter: progid:DXImageTransform.Microsoft.gradient( startColorstr=\'#ededed\', endColorstr=\'#ffffff\', GradientType=0 );\r\n	}\r\n</style>\r\n<div class=\"wrapper_page\">\r\n<div class=\"wrapper\">\r\n<table class=\"one-col table-logo\" style=\"border-collapse: collapse; border-spacing: 0; margin-left: auto; margin-right: auto; width: 590px; background-color: #ffffff;\">\r\n	<tbody>\r\n		<tr>\r\n			<td align=\"center\" height=\"80\" style=\"vertical-align: top; color: #666; font-size: 12px; text-align: center;\" valign=\"middle\"><img alt=\"\" src=\"https://cyberinsights.cyberinsights.vn/assets/image/logo.svg\" style=\"margin-top: 10px; height: 47px; width: 155px;margin-top: 10px;\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\"center\" style=\"vertical-align: top; color: #666; font-size: 12px; text-align: center;\" valign=\"middle\">\r\n			\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td height=\"35\">\r\n			<p style=\"margin-bottom: 5px; text-align: left;color: #000;margin-left: 30px;margin-top:20px\"><strong>K&iacute;nh gửi qu&yacute; kh&aacute;ch: {name_cmnd}</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td height=\"35\">\r\n						<p style=\"margin-bottom: 10px; text-align: left;color: #000; line-height: 28px;margin-left: 30px;\">Maritime Bank cảm ơn qu&yacute; kh&aacute;ch đ&atilde;&nbsp;đăng k&yacute; sử dụng sản phẩm thẻ t&iacute;n dụng Maritime Bank Platinum.</p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td height=\"35\">\r\n						<p style=\"margin-bottom: 10px; text-align: left;color: #000;line-height: 28px;margin-left: 30px;\">Maritime Bank xin tr&acirc;n trọng th&ocirc;ng b&aacute;o qu&yacute; kh&aacute;ch đ&atilde; đăng k&yacute; sử dụng thẻ t&iacute;n dụng Maritime Bank Platinum th&agrave;nh c&ocirc;ng tại trang <a href=\"\" style=\"color:#ca6f6d;font-weight:bold\">{link_referer}</a></p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td>\r\n						<p style=\"margin-bottom: 15px; color: rgb(0, 0, 0); line-height: 28px; margin-left: 30px; text-align: left; margin-right: 20px\">Maritime Bank sẽ li&ecirc;n hệ với qu&yacute; kh&aacute;ch trong khoảng<strong>&nbsp;{contact_time}<