pacing: 0; margin-left: auto; margin-right: auto; width: 590px; background-color: #ffffff;\">\r\n	<tbody>\r\n		<tr>\r\n			<td align=\"center\" height=\"80\" style=\"vertical-align: top; color: #666; font-size: 12px; text-align: center;\" valign=\"middle\"><img alt=\"\" src=\"https://cyberinsights.cyberinsights.vn/assets/image/logo.svg\" style=\"margin-top: 10px; height: 47px; width: 155px;\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\"center\" style=\"vertical-align: top; color: #666; font-size: 12px; text-align: center;\" valign=\"middle\">\r\n			\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td height=\"35\">\r\n			<p style=\"margin-bottom: 5px; text-align: left;color: #000;margin-left: 30px;margin-top:20px\"><strong>K&iacute;nh gửi qu&yacute; kh&aacute;ch: {name_cmnd}</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td height=\"35\">\r\n						<p style=\"margin-bottom: 10px; text-align: left;color: #000; line-height: 28px;margin-left: 30px;\">Maritime Bank cảm ơn qu&yacute; Kh&aacute;ch đ&atilde; lựa chọn sử dụng sản phẩm thẻ t&iacute;n dụng Maritime Bank Platinum.</p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td height=\"35\">\r\n						<p style=\"margin-bottom: 10px; text-align: left;color: #000;line-height: 28px;margin-left: 30px;\">Maritime Bank xin tr&acirc;n trọng th&ocirc;ng b&aacute;o qu&yacute;&nbsp;kh&aacute;ch đ&atilde; đăng k&yacute; ph&aacute;t h&agrave;nh thẻ t&iacute;n dụng Maritime Bank Platinum th&agrave;nh c&ocirc;ng. Dự kiến hạn mức t&iacute;n dụng của Qu&yacute; kh&aacute;ch l&agrave; <strong>{payment_limit}</strong> VND.</p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td>\r\n						<p style=\"margin-bottom: 15px;text-align: left;color: #000;line-height: 28px;margin-left: 30px; margin-right: 20px\">Đ&iacute;nh k&egrave;m email n&agrave;y l&agrave; đơn đăng k&yacute; sử dụng dịch vụ, hợp đồng ph&aacute;t h&agrave;nh v&agrave; sử dụng dich vụ v&agrave; hướng dẫn sử dụng thẻ để qu&yacute; kh&aacute;ch tham khảo.</p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td height=\"35\">\r\n						<p style=\"margin-bottom: 10px; text-align: left;color: #000;line-height: 28px;margin-left: 30px; margin-right: 20px\">Thẻ t&iacute;n dụng Maritime Bank Platinum sẽ được gửi tới qu&yacute; kh&aacute;ch h&agrave;ng trong v&ograve;ng 16 giờ l&agrave;m việc.</p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td height=\"35\">\r\n						<p style=\"margin-bottom: 10px; text-align: left;color: #000;line-height: 28px;margin-left: 30px; margin-right: 20px\">Maritime Bank sẽ li&ecirc;n hệ lại để giao Thẻ / PIN cho qu&yacute; Kh&aacute;ch:</p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td height=\"35\">\r\n						<p style=\"margin-bottom: 10px; text-align: left;color: #000;margin-left: 30px; margin-right: 20px\">Theo số điện thoại :<strong> {phone}</strong></p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td height=\"35\">\r\n						<p style=\"margin-bottom: 10px; text-align: left;color: #000;margin-left: 30px; margin-right: 20px\">Địa điểm dự kiến : <strong>{card_address}</strong></p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td height=\"35\">\r\n						<p style=\"margin-bottom: 10px; text-align: left;color: #000;margin-left: 30px; margin-right: 20px\">Thời gian dự kiến : <strong>{time_receive_card}</strong></p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td height=\"35\">\r\n						<p style=\"margin-bottom: 15px; text-align: left;color: #000;line-height: 28px;margin-left: 30px; margin-right: 20px\">Qu&yacute; kh&aacute;ch vui l&ograve;ng mang theo bảng ch&iacute;nh CMND / Passport / Thẻ căn cước c&ocirc;ng d&acirc;n đ&atilde; d&ugrave;ng để đăng k&yacute; mở thẻ với Maritime Bank.</p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td>\r\n						<p style=\"color:#666;margin-bottom: 10px;text-align: center;line-height: 28px;font-weight: bold\">Để biết th&ecirc;m th&ocirc;ng tin chi tiết, qu&yacute; kh&aacute;ch vui l&ograve;ng li&ecirc;n hệ:</p>\r\n\r\n						<div style=\"text-align: center;font-weight: bold;color:#666;\"><span style=\"display: inline-block;margin-right: 10px;\">1800 599 999</span> hoặc <span style=\"display: inline-block;margin-left: 10px;\">(84 24) 3944 5566.</span></div>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"line-height: 28px;font-size: 14px;padding-top: 30px\">\r\n			<p style=\"margin-left: 30px;margin-bottom: 30px\"><em>Tr&acirc;n trọng!</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>', '', '1516698917', '1', '1524214916', '1');
