der-spacing: 0; margin-left: auto; margin-right: auto; width: 590px; background-color: #ffffff;\">\r\n	<tbody>\r\n		<tr>\r\n			<td align=\"center\" height=\"80\" style=\"vertical-align: top; color: #666; font-size: 12px; text-align: center;\" valign=\"middle\"><img alt=\"\" src=\"https://cyberinsights.cyberinsights.vn/assets/image/logo.svg\" style=\"margin-top: 10px; height: 47px; width: 155px;margin-top: 10px;\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\"center\" style=\"vertical-align: top; color: #666; font-size: 12px; text-align: center;\" valign=\"middle\">\r\n			\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td height=\"35\">\r\n			<p style=\"margin-bottom: 5px; text-align: left;color: #000;margin-left: 30px;margin-top:20px\"><strong>K&iacute;nh gửi qu&yacute; kh&aacute;ch: {name_cmnd}​</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td height=\"35\">\r\n						<p style=\"margin-bottom: 10px; text-align: left;color: #000;line-height: 28px;margin-left: 30px\">Maritime Bank cảm ơn qu&yacute; kh&aacute;ch đ&atilde; lựa chọn sử dụng sản phẩm thẻ t&iacute;n dụng Maritime Bank Platinum.</p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td height=\"35\">\r\n						<p style=\"margin-bottom: 10px; text-align: left;color: #000;line-height: 28px;margin-left: 30px\">Maritime Bank xin tr&acirc;n trọng th&ocirc;ng b&aacute;o thẻ t&iacute;n dụng Maritime Bank Platinum của qu&yacute; kh&aacute;ch đ&atilde; được k&iacute;ch hoạt với hạn mức t&iacute;n dụng {payment_limit} VND v&agrave; sẵn s&agrave;ng để sử dụng.</p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td>\r\n						<p style=\"margin-bottom: 15px;text-align: left;color: #000;line-height: 28px;margin-left: 30px\">Thẻ t&iacute;n dụng Maritime Bank Platinum được thiết kế để mang đến cho qu&yacute; kh&aacute;ch những đặc quyền đẳng cấp, dịch vụ sang trọng c&ugrave;ng những tiện &iacute;ch nổi bật.</p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td height=\"35\">\r\n						<p style=\"margin-bottom: 10px; text-align: left;color: #000;line-height: 28px;margin-left: 30px\">Giờ đ&acirc;y, qu&yacute; kh&aacute;ch c&oacute; thể tận hưởng những tiện &iacute;ch đặc biệt chỉ c&oacute; ở thẻ t&iacute;n dụng Maritime Bank Platinum trong mọi giao dịch tr&ecirc;n to&agrave;n thế giới:</p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td>\r\n						<ul style=\"margin-bottom: 10px; text-align: left;color: #000; margin-left: 60px; text-align: justify; margin-right: 20px\">\r\n							<li style=\"margin-bottom: 10px;line-height: 28px;\">C&ocirc;ng nghệ bảo mật Chip EMV gi&uacute;p ngăn ngừa việc sao trộm th&ocirc;ng tin Chủ thẻ, giảm thiểu tối đa gian lận sử dụng thẻ</li>\r\n							<li style=\"margin-bottom: 10px; line-height: 28px;\">Thanh to&aacute;n h&agrave;ng h&oacute;a, r&uacute;t tiền mặt linh hoạt tại hơn 02 triệu ATM v&agrave; 25 triệu điểm chấp nhận thẻ MasterCard tr&ecirc;n to&agrave;n thế giới.</li>\r\n							<li style=\"margin-bottom: 10px; line-height: 28px;\">Hưởng đặc quyền tặng 5% số tiền chi ti&ecirc;u v&agrave;o ng&agrave;y sinh nhật, tối đa đến 500,000 VNĐ</li>\r\n							<li style=\"margin-bottom: 10px; line-height: 28px;\">Tận hưởng cuộc sống với ưu đ&atilde;i giảm đến 50% khi mua sắm với thế giới ưu đ&atilde;i JOY v&agrave; JOY+</li>\r\n						</ul>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td>\r\n						<p style=\"color:#666;margin-bottom: 10px;text-align: center;line-height: 28px;font-weight: bold\">Để biết th&ecirc;m th&ocirc;ng tin chi tiết, qu&yacute; kh&aacute;ch vui l&ograve;ng li&ecirc;n hệ:</p>\r\n\r\n						<div style=\"text-align: center;font-weight: bold;color:#666;\"><span style=\"display: inline-block;margin-right: 10px;\">1800 599 999</span> hoặc <span style=\"display: inline-block;margin-left: 10px;\">(84 24) 3944 5566.</span></div>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"line-height: 28px;font-size: 14px;padding-top: 30px\">\r\n			<p style=\"margin-left: 30px; margin-bottom: 30px; text-align: left;\"><em>Tr&acirc;n trọng!</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>', '', '1516698977', '1', '1524214865', '1');
