INSERT INTO `mail_settings` VALUES ('17', 'generate_password_success_template', null, 'Bạn đã được thêm vào hệ thống cybersales', '<meta charset=\"utf-8\">\r\n<title></title>\r\n<style type=\"text/css\">body {\r\n        margin: 0;\r\n        min-width: 100%;\r\n        font-family: \'Roboto\', Helvetica, Arial, sans-serif;\r\n        font-size: 14px;\r\n	 background-color: #ccc;\r\n    }\r\n	body,td,th,p,div {\r\n	font-family: Roboto, Helvetica, Arial, sans-serif;\r\n	font-size: 14px;\r\n}\r\n	.wrapper_page{\r\n		width:100%;\r\n		text-align: center;\r\n	}\r\n	.wrapper{\r\n		width: 590px;\r\n		margin: 50px auto;\r\n		margin-left: auto;\r\n		margin-right: auto;\r\n		background-color: #fff; \r\n		border:1px solid #ddd;\r\n		border-radius: 4px;\r\n	}\r\n	.bg{\r\n		 height: 251px\r\n		background: rgba(237,237,237,1);\r\nbackground: -moz-linear-gradient(top, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nbackground: -webkit-gradient(left top, left bottom, color-stop(0%, rgba(237,237,237,1)), color-stop(40%, rgba(255,255,255,1)), color-stop(100%, rgba(255,255,255,1)));\r\nbackground: -webkit-linear-gradient(top, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nbackground: -o-linear-gradient(top, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nbackground: -ms-linear-gradient(top, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nbackground: linear-gradient(to bottom, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nfilter: progid:DXImageTransform.Microsoft.gradient( startColorstr=\'#ededed\', endColorstr=\'#ffffff\', GradientType=0 );\r\n	}\r\n	body, html{\r\n		background-color: #cccccc;\r\n		background-color: #D0CDCD;\r\n		width:100%;\r\n	}\r\n	body,div{\r\n		border:none;\r\n	}\r\n</style>\r\n<div class=\"wrapper_page\">\r\n<div class=\"wrapper\">\r\n<table class=\"one-col table-logo\" style=\"border-collapse: collapse; border-spacing: 0; margin-left: auto; margin-right: auto;  background-color: #ffffff;\" width=\"590\">\r\n	<tbody>\r\n		<tr>\r\n			<td align=\"center\" height=\"80\" style=\"vertical-align: top; color: #666; font-size: 12px; text-align: center;\" valign=\"middle\"><img alt=\"\" src=\"https://cyberinsights.cyberinsights.vn/assets/image/logo.svg\" style=\"margin-top: 10px; height: 47px; width: 155px;\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\"center\" style=\"vertical-align: top; color: #666; font-size: 12px; text-align: center;\" valign=\"middle\">\r\n			\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td height=\"35\">\r\n			<p style=\"margin-bottom: 5px; text-align: left;color: #000; margin-left: 30px\"><strong>Xin ch&agrave;o {display_name},</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<p style=\"margin-bottom: 5px;text-align: left;color: #000;line-height: 28px;margin-left: 30px\">Bạn vừa được th&ecirc;m v&agrave;o hệ thống cyberinsights th&agrave;nh c&ocirc;ng với vai tr&ograve; <strong>{user_role_mul}</strong>, với mật khẩu <span style=\"font-weight: 700; color: rgb(50, 50, 50); font-size: 14px;\">{password}</span>.Để tiếp tục sử dụng hệ thống, vui l&ograve;ng truy cập <a href=\"{link_admin}\" style=\"color:#ca6f6d;font-weight: bold\">link</a>&nbsp;v&agrave; cập nhật c&aacute;c th&ocirc;ng tin của ch&iacute;nh m&igrave;nh.</p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"line-height: 28px;font-size: 14px;padding-top: 30px\">\r\n			<p style=\"margin-left: 30px; text-align: left;\"><em>Tr&acirc;n trọng!</em></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"line-height: 28px;font-size: 14px\">\r\n			<p style=\"margin-left: 30px; margin-bottom: 30px; text-align: left;\"><em>Đội ngũ cyberinsights</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>', '', '1519639285', '1', '1524210703', '1');
INSERT INTO `mail_settings` VALUES ('18', 'customer_khong_du_dieu_kien_template', null, 'Hủy bỏ đơn đăng ký phát hành thẻ tín dụng Maritime Bank Platinum', '<meta charset=\"utf-8\">\r\n<title></title>\r\n<style type=\"text/css\">body {\r\n        margin: 0;\r\n        min-width: 100%;\r\n        font-family: \'Roboto\', Helvetica, Arial, sans-serif;\r\n        font-size: 14px;\r\n	 background-color: #ccc;\r\n    }\r\n	body,td,th,p,div {\r\n	font-family: Roboto, Helvetica, Arial, sans-serif;\r\n	font-size: 14px;\r\n}\r\n	body,div{\r\n		border:none;\r\n	}\r\n	.wrapper_page{\r\n		width:100%;\r\n		text-align: center;\r\n	}\r\n	.wrapper{\r\n		width: 590px;\r\n		margin: 50px auto;\r\n		margin-left: auto;\r\n		margin-right: auto;\r\n		background-color: #fff; \r\n		border:1px solid #ddd;\r\n		border-radius: 4px;\r\n	}\r\n	body, html{\r\n		background-color: #cccccc;\r\n		background-color: #D0CDCD;\r\n		width:100%;\r\n	}\r\n	.bg{\r\n		 height: 251px\r\n		background: rgba(237,237,237,1);\r\nbackground: -moz-linear-gradient(top, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nbackground: -webkit-gradient(left top, left bottom, color-stop(0%, rgba(237,237,237,1)), color-stop(40%, rgba(255,255,255,1)), color-stop(100%, rgba(255,255,255,1)));\r\nbackground: -webkit-linear-gradient(top, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nbackground: -o-linear-gradient(top, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nbackground: -ms-linear-gradient(top, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nbackground: linear-gradient(to bottom, rgba(237,237,237,1) 0%, rgba(255,255,255,1) 40%, rgba(255,255,255,1) 100%);\r\nfilter: progid:DXImageTransform.Microsoft.gradient( startColorstr=\'#ededed\', endColorstr=\'#ffffff\', GradientType=0 );\r\n	}\r\n</style>\r\n<div class=\"wrapper_page\">\r\n<div class=\"wrapper\">\r\n<table class=\"one-col table-logo\" style=\"border-collapse: collapse; border-spacing: 0; margin-left: auto; margin-right: auto; width: 590px; background-color: #ffffff;\">\r\n	<tbody>\r\n		<tr>\r\n			<td align=\"center\" height=\"80\" style=\"vertical-align: top; color: #666; font-size: 12px; text-align: center;\" valign=\"middle\"><img alt=\"\" src=\"https://cyberinsights.cyberinsights.vn/assets/image/logo.svg\" style=\"margin-top: 10px; height: 47px; width: 155px;margin-top: 10px\" /></td>\r\n		</tr>\r\n		<tr>\r\n			<td align=\"center\" style=\"vertical-align: top; color: #666; font-size: 12px; text-align: center;\" valign=\"middle\">\r\n			\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td height=\"35\">\r\n			<p style=\"margin-bottom: 5px; text-align: left;color: #000;margin-left: 30px;margin-top:20px\"><strong>K&iacute;nh gửi qu&yacute; kh&aacute;ch: {name_cmnd}</strong></p>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td>\r\n			<table border=\"0\" cellpadding=\"0\" cellspacing=\"0\" width=\"100%\">\r\n				<tbody>\r\n					<tr>\r\n						<td height=\"35\">\r\n						<p style=\"margin-bottom: 10px; text-align: left;color: #000; line-height: 28px;margin-left: 30px;\">Maritime Bank cảm ơn qu&yacute; kh&aacute;ch đ&atilde; đăng k&yacute; sử dụng sản phẩm thẻ t&iacute;n dụng Maritime Bank Platinum tại trang <a href=\"{link_referer}\" style=\"color:#ca6f6d;font-weight:bold\">{link_referer}</a></p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td height=\"35\">\r\n						<p style=\"margin-bottom: 10px; text-align: left;color: #000; line-height: 28px;margin-left: 30px;\">Rất tiếc hiện tại qu&yacute; kh&aacute;ch chưa đủ điều kiện để ph&aacute;t h&agrave;nh thẻ theo chương tr&igrave;nh đ&atilde; đăng k&yacute;. Nếu qu&yacute; kh&aacute;ch c&oacute; nhu cầu l&agrave;m thẻ theo phương ph&aacute;p truyền thống của Maritime Bank, vui l&ograve;ng nhấn&nbsp;<a href=\"{link}\" style=\"color: rgb(202, 111, 109); font-size: 14px; background-color: rgb(255, 255, 255); font-weight: bold;\" target=\"_blank\">đ&acirc;y</a>&nbsp;Maritime Bank sẽ li&ecirc;n hệ để tư vấn ph&aacute;t h&agrave;nh v&agrave; sử dụng thẻ t&iacute;n dụng cho qu&yacute; kh&aacute;ch theo quy tr&igrave;nh truyền thống.</p>\r\n						</td>\r\n					</tr>\r\n					<tr>\r\n						<td>\r\n						<p style=\"color:#666;margin-bottom: 10px;text-align: center;line-height: 28px;font-weight: bold\">Để biết th&ecirc;m th&ocirc;ng tin chi tiết, qu&yacute; kh&aacute;ch vui l&ograve;ng li&ecirc;n hệ:</p>\r\n\r\n						<div style=\"text-align: center;font-weight: bold;color:#666;\"><span style=\"display: inline-block;margin-right: 10px;\">1800 599 999</span> hoặc <span style=\"display: inline-block;margin-left: 10px;\">(84 24) 3944 5566.</span></div>\r\n						</td>\r\n					</tr>\r\n				</tbody>\r\n			</table>\r\n			</td>\r\n		</tr>\r\n		<tr>\r\n			<td style=\"line-height: 28px;font-size: 14px;padding-top: 30px\">\r\n			<p style=\"margin-left: 30px; margin-bottom: 30px; text-align: left;\"><em>Tr&acirc;n trọng!</em></p>\r\n			</td>\r\n		</tr>\r\n	</tbody>\r\n</table>\r\n</div>\r\n</div>', '', '1524193638', '1', '1524728587', '1');
